import React from 'react';

class Click extends React.Component{ 

    handleClickNextBound(){
     console.log("next button clicked!")
   }
   
   render(){
   return (
       <div>
           <button onClick = {this.handleClickNextBound}> next </button>
       </div>
   )
   }
}

export default Click
